B.m9=new A.bt("Core Vaccines: These are essential for most pets and protect against common and potentially deadly diseases. For dogs, core vaccines often include rabies, distemper, parvovirus, and adenovirus. Cats typically receive core vaccines for rabies, feline viral rhinotracheitis, calicivirus, and panleukopenia.",null)
